import React from "react";

class Input extends React.Component { // placeholder type

  constructor(props){
    super(props)
  }

  onSubmit = () => {}

  render() {
    return(
      <input type={this.props.type} placeholder={this.props.name}></input>
    )
  }
}

export default Input;
